def binaryClassifier(df, positives = 1, labelCol = 'label', return_df = True, cache = True):
    '''splits the df into objects classified correctly "true" and wrongly "false".
    Returns two df if "return_df" = True and/or caches both if "cache" = True'''

    # Split data into true and falsely classified data
    tp = df.filter((col(labelCol)==col('prediction')) & (col(labelCol) == positives))
    tn = df.filter((col(labelCol)==col('prediction')) & (col(labelCol) != positives))
    fp = df.filter((col(labelCol)!=col('prediction')) & (col(labelCol) == positives))
    fn = df.filter((col(labelCol)!=col('prediction')) & (col(labelCol) != positives))

    if cache == True:
        tp.createOrReplaceTempView('true_positives')
        tn.createOrReplaceTempView('true_negatives')
        fp.createOrReplaceTempView('false_positives')
        fn.createOrReplaceTempView('false_negatives')
    if return_df == True:
        return (tp, tn, fp, fn)
    else: return 0

